  const newMap=[];
  const moveValues=[];
  const edgenums=[];
  var xSize = 5;
  var ySize = 5;
  var mapSize = xSize*ySize;
  const dir = [];


export default function App() {

  Mapinit();

  return (
    <View style={styles.container}>
      <Text>LOL tää toimii</Text>
      <StatusBar style="auto" />
      <FlatList
        data={newMap}
        extraData={newMap}
        renderItem={({item}) => <View style={drawmap(item)}>
          <Text style={styles.GridViewInsideTextItemStyle}>{item.numv}</Text>            
        </View>}
        numColumns={5}
      />
    </View>
  );
}

function MoveWorm(){
  var loc = 1;
  do{
    bestmove(loc);

    var bestdir = direction(dir.indexOf(Math.max.apply(null, array)));

    switch (bestdir) {
      case 'up': 
        loc - xSize;    
        break;
      case 'down':
        loc + xSize;      
        break;
      case 'left':
        loc - 1;        
        break;
      case 'right':
        loc + 1;        
        break;
    }

  }while(loc != mapSize)
}

function DistanceToEnd(loc){
  var distance;
  switch (loc) {
    case loc<6:
      distance = (loc - 5)+4;
      break;
    case loc<11:
      distance = (loc - 10)+3;
      break;
    case loc<16:
      distance = (loc - 15)+2;
      break;
    case loc<21:
      distance = (loc - 20)+1;
      break;
    case loc<26:
      distance = (loc - 25)+0;
      break;
  }

  return(
    distance
  )
}

function bestmove(loc){
  moves(loc)

  for (let index = 0; index < dir.length; index++) {
    var value = 25 - DistanceToEnd(dir[index]);
    if (blocks.includes(dir[index])){
      value = 0;
    }
    moveValues.push(value);
  }
}

function direction(index){
  const basicdir = ['up','down','left','right'];
  return(
    basicdir[index]
  )
}

function moves(loc){
  var down = loc + xSize;
  var up = loc - xSize;
  var left = loc - 1;
  var right = loc + 1;
  dir.unshift(up,down,left,right);
}

function Mapinit(){
  var blockobjectcount = 5;

  for (let index = 0; index < blockobjectcount; index++) {
    var randomnum = Math.floor(Math.random() * mapSize) + 1
    if (randomnum == 1){
      randomnum = randomnum + 1;
    }
    else if (randomnum == mapSize){
      randomnum = randomnum - 1;
    }
    blocks.push(randomnum);   
  }

  for (let index = 0; index < mapSize; index++) {
    var blocknum = index+1;
    if(blocks.includes(blocknum)){
      newMap.push({numv:index+1, func:'block'})
    }
    else if (blocknum < xSize || blocknum%ySize == 0 || blocknum%ySize == 1 || blocknum > mapSize-xSize){
      edgenums.push(blocknum)
      newMap.push({numv:index+1, func:'free'})
    }
    else{
      newMap.push({numv:index+1, func:'free'})
    }
  }
}

function listwithzeros(size){
  const element = [];
  for (let index = 0; index < size; index++) {
    element.push(0);
  }

  return(element);
}

function drawmap(item){
   var blockstyle;

  if (item.func == 'block'){
    blockstyle = styles.mapblock;
  }
  else if (item.func == 'worm'){
    blockstyle = styles.mapworm;
  }
  else{
    blockstyle = styles.mapfree;
  }
  return(blockstyle);
}



